      function AfterPForm return boolean is
	  L_MSG VARCHAR2(6);
  L_TMP NUMBER(9) := 0;
  L_OBL CHAR(1);
  l_direction client_mo.clidir%type;
begin
	SELECT TO_NUMBER(TO_CHAR(datdebex.moismens,'YYYY')),
		TO_CHAR(datdebex.moismens) INTO :P_ANNEE , :P_MOISMENS
	FROM datdebex;
	:P_WHERE := ' ';

		:P_NUMSEQ := pack_cout_standard_ke.insert_tmp_coutke_dmdlbip(:P_ANNEE,'',NULL,NULL,NULL,:P_PARAM1, :P_GLOBAL, '00000000000');
		:P_NUMSEQ_2 := PACK_LIGNE_BIP.DEMANDE_LIGNE_BIP(NULL);
	
	
	---CARROT CHANGES BEGINS
	DELETE FROM TEMP_DMP_PID;
	
	DELETE FROM TEMP_DMP_PID;
  FOR i IN
  (SELECT l.PID,
    l.CODSG
  FROM LIGNE_BIP l,
    DATDEBEX d
  WHERE ( extract (YEAR FROM l.ADATESTATUT) >= extract (YEAR FROM d.MOISMENS) OR L.adatestatut IS NULL)
  )
  LOOP
    --check direct link
    Pack_Ligne_Bip.CHECK_DMPLINK(I.PID,L_MSG,L_OBL );
    IF L_MSG = 'LINK' THEN
      INSERT INTO TEMP_DMP_PID VALUES
        (I.PID
        );
    ELSE
      -- CHECK INDIRECT LINK -- DP COPY
      BEGIN
        SELECT CMO.clidir
        INTO l_direction
        FROM client_mo CMO,
          ligne_bip LB
        WHERE LB.pid   = I.PID
        AND LB.clicode = CMO.clicode;
        
        SELECT 1
        INTO L_TMP
        FROM ligne_param_bip
        WHERE code_action = 'AXEMETIER_'
          || l_direction
        AND code_version LIKE 'DPC%'
        AND upper(actif) = 'O';
        
        INSERT INTO TEMP_DMP_PID VALUES
          (I.PID
          );
      EXCEPTION
      WHEN NO_DATA_FOUND THEN
        BEGIN
          ---- CHECK INDIRECT LINK -- PROJECT
         
          SELECT 1
          INTO L_TMP
          FROM ligne_param_bip
          WHERE code_action = 'AXEMETIER_'
            || l_direction
          AND code_version LIKE 'PRJ%'
          AND upper(actif) = 'O';
          
          INSERT INTO TEMP_DMP_PID VALUES
            (I.PID
            );
        EXCEPTION
        WHEN NO_DATA_FOUND THEN
          BEGIN
          
            SELECT CODDIR INTO l_direction FROM STRUCT_INFO WHERE CODSG = I.CODSG;
            
            SELECT 1
            INTO L_TMP
            FROM ligne_param_bip
            WHERE code_action = 'AXEMETIER_'
              || l_direction
            AND code_version LIKE 'PRJ%'
            AND upper(actif) = 'O';
            
            INSERT INTO TEMP_DMP_PID VALUES
              (I.PID
              );
          EXCEPTION
          WHEN NO_DATA_FOUND THEN
            NULL;
          END;
        END;
      END;
    END IF;
  END LOOP;
  COMMIT;

	return (TRUE);
end;

      function P_PARAM_9ValidTrigger return boolean is
begin
  
  return (TRUE);
end;

      function AfterReport return boolean is
begin
  DELETE FROM TMP_COUTKE_ETATS WHERE NUMSEQ = :P_NUMSEQ ; 
  DELETE FROM TMP_CONSO_DMP WHERE NUMSEQ = :P_NUMSEQ_2 ; -- KRA 62325
  COMMIT ; 
  
  return (TRUE);
end;
